$(document).ready(function(){const e=document.querySelector(".hamburger"),t=document.querySelector(".nav-links"),n=document.querySelectorAll(".nav-links li");if(e.addEventListener("click",()=>{t.classList.toggle("open"),n.forEach(e=>{e.classList.toggle("fade")}),e.classList.toggle("toggle")}),window.matchMedia("(min-width: 990px)").matches){let e=gsap.utils.toArray(".panel");gsap.to(e,{xPercent:-100*(e.length-1),ease:"none",scrollTrigger:{trigger:".front-page",pin:!0,scrub:1,snap:1/(e.length-1),end:()=>"+="+document.querySelector(".front-page").offsetWidth}}),$(document).ready(function(){$("header").midnight()})}});